<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8"/>
<meta name="viewport" content="width=device-width,initial-scale=1"/>
<title>Tilt Winter 2026 — Matches Dashboard</title>
<style>
body{font-family:system-ui,-apple-system,Segoe UI,Roboto,Helvetica,Arial,sans-serif;margin:24px;line-height:1.35}
h1{margin:0 0 8px 0}
.small{color:#555;font-size:14px}
.grid{display:grid;grid-template-columns:1fr;gap:16px;max-width:1100px}
.card{border:1px solid #ddd;border-radius:12px;padding:16px;box-shadow:0 1px 2px rgba(0,0,0,.04)}
.row{display:flex;gap:12px;flex-wrap:wrap;align-items:flex-end}
label{font-size:13px;color:#333;display:block;margin-bottom:4px}
select,input{padding:8px 10px;border:1px solid #ccc;border-radius:10px;font-size:14px}
button{padding:9px 12px;border:1px solid #ccc;border-radius:10px;background:#f7f7f7;cursor:pointer}
button:hover{background:#efefef}
table{border-collapse:collapse;width:100%}
th,td{border-bottom:1px solid #eee;padding:8px 10px;text-align:left;font-size:14px}
th{position:sticky;top:0;background:white;z-index:1}
thead th{border-bottom:1px solid #ddd}
.right{text-align:right}
.badge{display:inline-block;padding:2px 8px;border-radius:999px;background:#f1f1f1;font-size:12px;color:#333}
.mono{font-variant-numeric:tabular-nums}
.scroll{max-height:420px;overflow:auto;border:1px solid #eee;border-radius:12px}
.note{color:#666;font-size:13px;margin-top:8px}
hr{border:none;border-top:1px solid #eee;margin:12px 0}
</style>
</head>
<body>
  <div class="grid">
    <div>
      <h1>Tilt Winter 2026 — Matches Dashboard</h1>
      <div class="small">Rows loaded: <span class="mono" id="nMatches"></span> matches • <span class="mono" id="nPlayers"></span> players</div>
    </div>

    <div class="card">
      <h2 style="margin:0 0 10px 0;font-size:18px;">Head-to-head</h2>
      <div class="row">
        <div>
          <label for="p1">Player 1</label>
          <select id="p1"></select>
        </div>
        <div>
          <label for="p2">Player 2</label>
          <select id="p2"></select>
        </div>
        <div>
          <button id="swap">Swap</button>
          <button id="clear">Clear</button>
        </div>
      </div>
      <div id="h2hSummary" style="margin-top:12px;"></div>
      <div class="note">Tip: Search below, then click a name in the stats table to auto-fill Player 1.</div>
    </div>

    <div class="card">
      <h2 style="margin:0 0 10px 0;font-size:18px;">Player stats</h2>
      <div class="row">
        <div>
          <label for="search">Search player</label>
          <input id="search" placeholder="Type a name…"/>
        </div>
        <div>
          <label for="minMatches">Min matches</label>
          <input id="minMatches" type="number" min="0" value="0" style="width:120px"/>
        </div>
        <div>
          <label for="sortBy">Sort</label>
          <select id="sortBy">
            <option value="win_pct">Win %</option>
            <option value="wins">Wins</option>
            <option value="matches">Matches</option>
            <option value="game_diff">Game diff</option>
          </select>
        </div>
      </div>

      <div class="scroll" style="margin-top:12px;">
        <table id="statsTable">
          <thead>
            <tr>
              <th>Player</th>
              <th class="right">Matches</th>
              <th class="right">W</th>
              <th class="right">L</th>
              <th class="right">Win %</th>
              <th class="right">Games W</th>
              <th class="right">Games L</th>
              <th class="right">Game diff</th>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
      <div class="note">Click a player name to set Player 1 for head-to-head.</div>
    </div>
  </div>

const nMatchesEl = document.getElementById("nMatches");
const nPlayersEl = document.getElementById("nPlayers");
nMatchesEl.textContent = MATCHES.length.toLocaleString();
nPlayersEl.textContent = STATS.length.toLocaleString();

const p1 = document.getElementById("p1");
const p2 = document.getElementById("p2");
const swapBtn = document.getElementById("swap");
const clearBtn = document.getElementById("clear");
const summary = document.getElementById("h2hSummary");

function uniquePlayers() {
  return STATS.map(x => x.player).sort((a,b)=>a.localeCompare(b));
}

function fillSelect(sel) {
  sel.innerHTML = "";
  const opt0 = document.createElement("option");
  opt0.value = "";
  opt0.textContent = "— select —";
  sel.appendChild(opt0);

  for (const name of uniquePlayers()) {
    const opt = document.createElement("option");
    opt.value = name;
    opt.textContent = name;
    sel.appendChild(opt);
  }
}

function fmtPct(x) {
  return (100*x).toFixed(1) + "%";
}

function htmlEscape(s) {
  return String(s).replaceAll("&","&amp;").replaceAll("<","&lt;").replaceAll(">","&gt;")
                  .replaceAll('"',"&quot;").replaceAll("'","&#39;");
}

function h2h(a,b) {
  if (!a || !b || a===b) return null;
  let aWins=0, bWins=0, aGames=0, bGames=0, n=0;
  const rows=[];
  for (const m of MATCHES) {
    const isAB = (m.a===a && m.b===b);
    const isBA = (m.a===b && m.b===a);
    if (!(isAB || isBA)) continue;
    n++;
    let aScore, bScore;
    if (isAB) {
      aScore = m.sa; bScore = m.sb;
    } else {
      aScore = m.sb; bScore = m.sa;
    }
    aGames += aScore;
    bGames += bScore;
    if (aScore > bScore) aWins++; else bWins++;
    rows.push({aScore, bScore});
  }
  return {a,b,n,aWins,bWins,aGames,bGames,rows};
}

function renderH2H() {
  const a=p1.value, b=p2.value;
  const res=h2h(a,b);
  if (!res) {
    summary.innerHTML = '<div class="small">Pick two different players to see head-to-head.</div>';
    return;
  }
  const aRate = res.n ? res.aWins/res.n : 0;

  let listHtml="";
  const show = res.rows.slice(0,25);
  if (show.length) {
    listHtml = "<hr/><div class='small'><span class='badge'>First 25 matches in file order</span></div>"
      + "<div style='margin-top:8px;max-height:220px;overflow:auto;border:1px solid #eee;border-radius:12px;'>"
      + "<table><thead><tr><th>#</th><th>"+htmlEscape(res.a)+"</th><th>"+htmlEscape(res.b)+"</th><th>Winner</th></tr></thead><tbody>";
    show.forEach((r,idx)=>{
      const winner = (r.aScore>r.bScore) ? res.a : res.b;
      listHtml += `<tr>
        <td class="mono right">${idx+1}</td>
        <td class="mono right">${r.aScore}</td>
        <td class="mono right">${r.bScore}</td>
        <td>${htmlEscape(winner)}</td>
      </tr>`;
    });
    listHtml += "</tbody></table></div>";
  }

  summary.innerHTML = `
    <div style="display:flex;gap:16px;flex-wrap:wrap;align-items:flex-start;">
      <div class="card" style="padding:12px;border-radius:12px;min-width:260px;">
        <div class="small">Matches between them</div>
        <div style="font-size:22px;font-weight:700" class="mono">${res.n.toLocaleString()}</div>
      </div>
      <div class="card" style="padding:12px;border-radius:12px;min-width:260px;">
        <div class="small">${htmlEscape(res.a)} record</div>
        <div style="font-size:22px;font-weight:700" class="mono">${res.aWins}–${res.bWins} (${fmtPct(aRate)})</div>
        <div class="small mono">Games: ${res.aGames}–${res.bGames}</div>
      </div>
    </div>
    ${listHtml}
  `;
}

p1.addEventListener("change", renderH2H);
p2.addEventListener("change", renderH2H);
swapBtn.addEventListener("click", () => {
  const tmp=p1.value; p1.value=p2.value; p2.value=tmp; renderH2H();
});
clearBtn.addEventListener("click", () => {
  p1.value=""; p2.value=""; renderH2H();
});

fillSelect(p1);
fillSelect(p2);
renderH2H();

// Stats table
const tbody = document.querySelector("#statsTable tbody");
const searchEl = document.getElementById("search");
const minMatchesEl = document.getElementById("minMatches");
const sortByEl = document.getElementById("sortBy");

function renderStats() {
  const q = searchEl.value.trim().toLowerCase();
  const minM = parseInt(minMatchesEl.value || "0", 10);
  const sortBy = sortByEl.value;

  let rows = STATS.filter(r => (r.matches >= minM) && (!q || r.player.toLowerCase().includes(q)));

  rows.sort((x,y)=> {
    const ax=x[sortBy], ay=y[sortBy];
    if (ay===ax) return x.player.localeCompare(y.player);
    return (ay>ax) ? 1 : -1;
  });

  tbody.innerHTML = "";
  for (const r of rows) {
    const tr=document.createElement("tr");
    tr.innerHTML = `
      <td><a href="#" data-player="${htmlEscape(r.player)}">${htmlEscape(r.player)}</a></td>
      <td class="right mono">${r.matches}</td>
      <td class="right mono">${r.wins}</td>
      <td class="right mono">${r.losses}</td>
      <td class="right mono">${fmtPct(r.win_pct)}</td>
      <td class="right mono">${r.games_won}</td>
      <td class="right mono">${r.games_lost}</td>
      <td class="right mono">${r.game_diff}</td>
    `;
    tbody.appendChild(tr);
  }

  tbody.querySelectorAll("a[data-player]").forEach(a => {
    a.addEventListener("click", (ev)=>{
      ev.preventDefault();
      const name = ev.target.getAttribute("data-player");
      p1.value = name;
      renderH2H();
      window.scrollTo({top:0, behavior:"smooth"});
    });
  });
}

searchEl.addEventListener("input", renderStats);
minMatchesEl.addEventListener("input", renderStats);
sortByEl.addEventListener("change", renderStats);
renderStats();
</script>
